import React, { useState } from 'react';
import Header from "./Header";
import Intro from "./Intro";

function Gallery() {
    return (
    <div>
        <Header />
        <Intro name={"Gustavo"} />
        <ButtonLocation onClick={fetchCepData} />
        <Info />
    </div>
  );
}

export default Gallery;
